import PropTypes from "prop-types";
import React from "react";
import TeamMemberOneSingle from "./SuggestionOneSingle";

const SuggestionOne = () => {
  const teamMemberData = [{
    "suggestion_id": 11,
    "user_id": 1,
    "contents": "강남역 약속",
    "location": "강남역",
    "routine": [
        "목","금"
    ],
    "start": [
        "2021-12-23",
        "2021-12-24"
    ],
    "end": null,
    "classification": null,
    "type": "ROUTINE"
}]
  return (
    <div className='team-area'>
        <div className="">
          {teamMemberData &&
            teamMemberData.map((single, key) => {
              return (
                <SuggestionOneSingle
                  data={single}
                  key={key}
                />
              );
            })}
        </div>
      </div>

  );
};

export default SuggestionOne;
